import './catalog.css';
import '../components/quantitypicker.jsx';
import QuantityPicker from '../components/quantitypicker';

function Catalog(){
    return(
        <div className="catalog">
            <h1>Check our amazing catalog</h1>
            
        <QuantityPicker />
        </div>
    );
}

export default Catalog;
